e and software for the new system.</li>\\n</ol>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"7d99053e-f16b-432c-8824-5db05106b4f3\"},\"title\":\"Learning Outcomes\"}],\"hTag\":\"h2\"},\"library\":\"H5P.Accordion 1.0\",\"metadata\":{\"contentType\":\"Accordion\",\"license\":\"U\",\"title\":\"Lesson Overview\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Lesson Overview\"},\"subContentId\":\"aeff58be-9ee7-44a5-b33c-bcc8f04bbeeb\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h2><strong>The Big Picture</strong></h2>\\n\\n<p>The final stage of the SDLC is the evaluation stage. The purpose of this is to evaluate the effectiveness of the system.</p>\\n\\n<p>Evaluation usually takes place after the system has been implemented and running for a period of time. This depends on the size and complexity of the system and may happen a few weeks later or even a few months later. Evaluation is an ongoing process and may be undertaken in-house, by the systems analyst or by an independent external evaluator.</p>\\n\\n<p>Effective evaluation is dependent on the quality of the information gathered and feedback given when reviewing the system. Methods used are similar to those used in the initial systems analysis, such as questionnaires, interviews and observation.</p>\\n\\n<p>On completion of the evaluation stage recommendations may be made to change or update the hardware, software, systems or working procedures. If the system does not meet its intended goals then the SDLC may begin again to create a new or revised system.</p>\\n\\n<p>The following video outlines the SDLC evaluation stage:</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"dd256000-927d-4cf2-9380-7b9609fe506e\"},\"useSeparator\":\"auto\ mal user training required?</li>\\n\\t<li>Does the system meet the needs of all stakeholders, including users, customers, suppliers, managers, etc.</li>\\n\\t<li>Does the system meet all the needs specified in the original requirements?</li>\\n</ul>\\n\\n<p>Evaluation and any recommended corrective action conclude the SDLC. However, the SDLC is a cyclical process that may begin again with further analysis, design implementation etc.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"37484f6b-af98-4539-8233-a6c2e92b04cb\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":true,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAANGCAYAAADtTXdFAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAcv5JREFUeNrs3X2IZeW9L/iVnEC8E3vsO3/Y7cyIlYS8MFDa5g/zAkfLIdEhgdiecDpchFiNxFyI3rYzXPRy4mmNOWA4ELuJhxk9iKUzMqQvSdpAhJiApRfyIoNpLbjk5SYprwxpe/441bQZzF+Z9dt7PZWnd++132q/rF3784HNrpe111772VX7edZ3PS9FAQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAwIS9QxEAwPScfOP8SnkXt2vK214lAo2zVd5eLW/rh67cs644AKAZBFgAMGEn3zh/sLy7vbwdVBowd06Vt6cOXbnnlKIAgNkRYAHAhFTB1SPlbUlpwNzbLG9HBVkAMBsCLAAYs5NvnI+hgd8r2kMFgd1lvbzdeujKPVuKAgCmR4AFAGNUzXEV4ZX5rWD3ivDqVnNkAcD0vFMRAMB4nHzj/Gp590IhvILdLv7HX6j+5wGAKdADCwDGoDqRfVJJwMI5fOjKPWuKAQAmS4AFADt08o3zB8q7XygJWFjXHrpyz2nFAACTI8ACgB2oJmz/fWHYICyymBPrvSZ2B4DJMQcWAOxMDBs
